VALUES ('3215690804037', '240G Boite Assortiment Caramel Dupont D\'isigny', 'Caramels au beurre salé et à la fleur de sel de Guérande : Sirop de glucose, sucre, beurre salé (9%), lait écrémé en poudre, fleurde sel de Guérande (1%), dextrose, émulsifiant : E471, colorant : E150a, antioxydant : 807. Traces éventuelles de soja et de fruits à coque. Assortiment de caramels tendres au lait frais d\'Isigny aromatisés (vanille - café - chocolat - noisette) : Lait frais entier (57 %), sirop de glucose, sucre, beurre concentré, noisettes grillées (2,8%)*, cacao maigre en poudre (2,8%)*, chocolat (1,8%)* (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de soja, extrait de vanille), extrait de café (1,8 %)*, dextrose, café en poudre (0,4%)*, émulsifiant : E471r sel, arômes, antioxydant : 807. dans le caramel faisant référence à l\'aromatisation. Traces éventuelles d\'autres fruits à coque. Conseils de conservation:A conserver à Cabri de ta chaleur et de l\'humidité.', 'https://static.openfoodfacts.org/images/products/321/569/080/4037/front_fr.17.400.jpg', '8.5', '6.1', '78', '60', '', '2.4', '0.4', '0.15748031496063', '', '0');

